import React, { Component } from "react";
import { Link, NavLink } from "react-router-dom";

export default class Navbar extends Component {
  filterCities = (e) => {
    this.props.filteredCities(e.target.value);
  };
  filterContinent = (e) => {
    this.props.filterContinent(e.target.value);
  };
  componentWillUnmount = () => {
    this.props.filteredCities("");
    this.props.filterContinent("");
  };
  displayUserLoggedOrNot = () => {
    console.log(this.props.LoggedUser);
    if (!this.props.LoggedUser) {
      return (
        <div className="nav">
          <NavLink to="/logIn" activeStyle className="logo">
            Log in
          </NavLink>
          <div className="inputs">
            <input
              className="search"
              type="text"
              placeholder=" Search city or country"
              value={this.props.searchCity}
              onChange={(event) => {
                this.filterCities(event);
              }}
            ></input>
            <select
              className="search"
              onChange={(event) => {
                this.filterContinent(event);
              }}
            >
              <option value="">All Contenints</option>
              <option value="Asia">Asia</option>
              <option value="Africa">Africa</option>
              <option value="Europe">Europe</option>
              <option value="North America">North America</option>
              <option value="South America">South America</option>
              <option value="Oceania">Oceania</option>
            </select>
          </div>
        </div>
      );
    } else {
      return (
        <div className="nav">
          {console.log(this.props.LoggedUser)}
          <NavLink to="/logOut" activeStyle className="logo">
            LogOut
          </NavLink>

          <div className="inputs">
            <input
              className="search"
              type="text"
              placeholder=" Search city or country"
              value={this.props.searchCity}
              onChange={(event) => {
                this.filterCities(event);
              }}
            ></input>
            <select
              className="search"
              onChange={(event) => {
                this.filterContinent(event);
              }}
            >
              <option value="">All Contenints</option>
              <option value="Asia">Asia</option>
              <option value="Africa">Africa</option>
              <option value="Europe">Europe</option>
              <option value="North America">North America</option>
              <option value="South America">South America</option>
              <option value="Oceania">Oceania</option>
            </select>
          </div>
          <div className="userInfo">
            <h6>{this.props.LoggedUser.userName}</h6>
            <h6>{this.props.LoggedUser.Email}</h6>
            <img src={this.props.LoggedUser.picture}></img>
          </div>
        </div>
      );
    }
  };
  render() {
    return this.displayUserLoggedOrNot();
  }
}
